// import Login from "./login";
import SignUp from "./signup";
import { BrowserRouter as Router , Route , Switch } from "react-router-dom";
import Login from "./login";

function App() {
  return (
    <>
      <Router>
          <Route path="./" component={Login} exact />
          <Route path="./signup" component={SignUp} exact />
      </Router>
    </>
  );
}

export default App;
